class UserInformation extends Component {
    render() {
        const address = this.props.user.address;
        const picture = this.state.user.picture ? 
            <img src={this.state.user.picture} width="30" height="30" className="rounded-circle" /> : 
            <img src={DefaultImage} width="30" height="30" className="rounded-circle" />;
        return (
            <div>
                <div className="row p-5">
                    <div className="col-md-4">
                        <div className="row">
                            {picture}
                        </div>
                        <div className="row">
                            <h6 className="text-muted">{this.props.user.firstName} {this.props.user.lastName}</h6><br />
                            <p>{address}</p><br />
                            <p>{this.props.user.email}</p><br />
                            <p>{this.props.user.phone}</p><br />
                        </div>
                    </div>
                    <div className="col-md-8">

                    </div>

                </div>
            </div>
        );
    }
}

export default UserInformation;
